function drawColumnStacked() {
    var data = google.visualization.arrayToDataTable([
            ["Index", "Sangat Puas", "Puas", "Cukup Puas", "Tidak Puas", "Sangat Tidak Puas", {
                role: "annotation"
            }],
            ["Kesesuaian Persyaratan Pelayanan", 10, 15, 25, 35, 45, ""],
            ["Kemudahan Sistem/Mekanisme/Prosedur Pelayanan", 12, 20, 25, 32, 36, ""],
            ["Kecepatan Waktu Dalam Memberikan Pelayanan", 5, 24, 20, 34, 17, ""],
            ["Kewajaran biaya/Tarif dalam Pelayanan", 18, 25, 30, 25, 24, ""],
            ["Kesesuaian Produk Pelayanan antara yan Tercantum dalam standar Pelayanan", 16, 22, 23, 28, 15, ""],
            ["Kompeten Atau Kemampuan Petugas Dalam Pelayanan", 8, 26, 20, 42, 30, ""],
            ["Perilaku Petugas dalam Pelayanan", 24, 17, 24, 35, 14, ""],
            ["Penanganan Pengaduan", 24, 17, 24, 35, 14, ""],
            ["Kualitas Sarana dan Prasarana", 24, 17, 24, 35, 14, ""]
        ]),
        options_column_stacked = {
            height: 400,
            fontSize: 12,
            colors: ["#66ff99", "#66ffff", "#ffff00", "#ff9933", "#ff5050"],
            chartArea: {
                left: "5%",
                width: "90%",
                height: 350
            },
            vAxis: {
                gridlines: {
                    color: "#e9e9e9",
                    count: 10
                },
                minValue: 0
            },
            legend: {
                position: "top",
                alignment: "center",
                textStyle: {
                    fontSize: 12
                }
            }
        },
        bar = new google.visualization.ColumnChart(document.getElementById("Bar_IKP"));
    bar.draw(data, options_column_stacked)
}
google.load("visualization", "1.0", {
    packages: ["corechart"]
}), google.setOnLoadCallback(drawColumnStacked), $(function() {
    function resize() {
        drawColumnStacked()
    }
    $(window).on("resize", resize), $(".menu-toggle").on("click", resize)
});